import React, { Component } from 'react';

class BasicInfo extends Component {
    constructor(props) {
        super();
        this.state = {
            persopeo: {        
                name: props.name,
                age: props.age,
                dateOfBirth: props.dateOfBirth,
                number: props.number,
                email: props.email,
                }
        };
    }

    render() {
        return (
            <div className="peo">
                <h1>{this.state.peo.name}</h1>
                <p> Age: {this.state.peo.age}</p>
                <p> DOB: {this.state.peo.dateOfBirth}</p>
                <p> Phone Number: {this.state.peo.number}</p>
                <p> Email: {this.state.peo.email}</p>
            </div>
        );
    }
}

export default BasicInfo;
